  const navigate = useNavigate();

  // 입력 정보 처리
  const [state, setState] = useState({
    community_name: "",
    community_picture: "",
    community_allow: "",
  });
  return (
    <div>
      <button
        onClick={() => {
          navigate(-1);
        }}
      >
        뒤로가기
      </button>
      <p>여기는 커뮤니티 생성 페이지입니다.</p>
      <div>
        <input
          name="community_name"
          value={state.community_name}
          onChange={() => {}}
        />
      </div>
    </div>
  );
};

